public static String printable(String s) {
  StringBuffer sb = new StringBuffer();
  for (int i=0; i<s.length(); i++) {
    char ch = s.charAt(i);
    if (ch<=' ' || ch>=128) {
      sb.append("(" + (int)ch + ")");
    } else {
      sb.append(ch);
    }
  }
  return sb.toString();
}

public static String printable(String s) {
  StringBuilder sb = new StringBuilder();
